import { INCREMENT_COUNTER } from "./testConstants";

const initialState = {
  data: 42
};

const TestReducer = (state = initialState,action) => {
  switch(action.type){
    case INCREMENT_COUNTER:
      RET
  }
  return state;
};

export default TestReducer;
